import React, { Component } from 'react';
import "./dictionary.scss";

class Dictionary extends Component {
    state = {}
    render() {
        return <div>
            <span className="select-text">自动检测语言</span>
            <button className="translate">翻译</button>
            <div className="translate-weapper">
                <textarea name="input" id="input" cols="30" rows="10"></textarea>
                <textarea name="output" id="output" cols="30" rows="10"></textarea>
            </div>

        </div>;
    }
}

export default Dictionary;
